const all = {
  skull: {
    def: require("./models_def/skull.json"),
    thumb: require("../../assets/3d/mod_thumb/thumb_skull.png"),
  },
  knife: {
    def: require("./models_def/knife.json"),
    thumb: require("../../assets/3d/mod_thumb/thumb_knife.png"),
  },
  bullet: {
    def: require("./models_def/bullet.json"),
    thumb: require("../../assets/3d/mod_thumb/thumb_bullet.png"),
